    render() {

        if(this.props.match.params.symbol) {
        console.log("STATISTIC tickerToLOOK", this.props.match.params.symbol)
        }
        return (
        
            <div className="statistic">
                <div className="statistic-column">
                    <div className="statistic-column-container">
                        <div className="statistic-column-container-key">

                        </div>
                        <div className="statistic-column-container-key">
                            
                        </div>
                    </div>
                   

                </div>
                <div className="statistic-column">
                
                    

                </div>
                
            </div>
            
        )
    }
}
